"original": |2-
     The time zone of this attribute might not be the time zone used by
     people located near the Printer or device.  The Client MUST NOT
     expect the time zone of any received 'dateTime' value to be in the
     time zone of the Client or in the time zone of the people located
     near the Printer.
"fixed": |-
  The time zone of this attribute might not be the time zone used by people located near the Printer or device.  The Client MUST NOT expect the time zone of any received 'dateTime' value to be in the time zone of the Client or in the time zone of the people located near the Printer.
"ko": |-
  이 속성의 시간대는 프린터나 장치 근처에 있는 사람들이 사용하는 시간대가 아닐 수도 있습니다. 클라이언트는 수신된 'dateTime' 값의 시간대가 클라이언트의 시간대 또는 프린터 근처에 있는 사람들의 시간대에 있을 것으로 기대해서는 안 됩니다.
